css:
.exporter-view {
  padding: 16px;
}
.exporter-view h4 {
  margin-bottom: 24px;
}
.exporter-view .splitter {
  width: 100%;
  height: 1px;
  margin-bottom: 16px;
  background-color: #31363f;
}
.exporter-view .clearfix:after {
  content: " ";
  display: block;
  height: 0;
  clear: both;
}
.exporter-view .document-type-div {
  margin-bottom: 16px;
}
.exporter-view .document-type-div div {
  width: 64px;
  height: 24px;
  text-align: left;
  float: left;
  padding-left: 6px;
  font-size: 12px;
  line-height: 24px;
  border-left: 4px solid #31363f;
}
.exporter-view .document-type-div div:hover {
  background-color: #3e4451;
  cursor: pointer;
}
.exporter-view .document-type-div div.selected {
  border-left-color: #2F94BD;
  font-weight: 600;
  background-color: #545d6d;
}
.exporter-view .document-type-div .document-phantomjs {
  width: 100px;
}
.exporter-view .document-type-div .document-prince {
  width: 98px;
}
.exporter-view .button-group {
  margin-top: 24px;
}
.exporter-view .button-group .close-btn {
  margin-right: 16px;
}
.exporter-view .button-group .export-btn {
  background-image: linear-gradient(#2f94bd, #2790bb);
  color: #fff;
  border: none;
}
.exporter-view .button-group .export-btn:hover {
  background-image: linear-gradient(#53b0d6, #4195b7);
}
.exporter-view input[type="checkbox"] {
  margin-left: 12px;
}
.exporter-view select,
.exporter-view .image-quality-input {
  background-color: #1f2228;
  border-color: #3e4451;
  margin: 0 6px;
}
.exporter-view .cdn-checkbox,
.exporter-view .relative-image-path-checkbox,
.exporter-view .embed-local-images-checkbox {
  margin-right: 6px;
}
